import { Link } from "react-router-dom";

export default function CartWidget() {
    return (
        <li>
            <Link to="carrito">
                <img src={cart}/>
                <p className="m-0">Carrito</p>
                <span className="cartNotification">1</span>
            </Link>
        </li>
    )
}
